import React from 'react';
import Header from './components/Header';
import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import HeroSection from './components/HeroSection';

function App() {
  return (
    <>
      <Router>
        <Header />
        <HeroSection />
      </Router>
    </>
  );
}

export default App;
